import '../App.css';

let pages=['About Us', 'Preventative Measures', 'Top 10 Dangerous Roads', 'Current Weather Map', 'Machine Learning Map'];

function App() {
  return (
    <div className="navbar-content-area">
        <div className="navbar-">
            <div>
                Whether Weather
            </div>
            {pages.map((item,index)=>{
                return <div key={index} className="navbar-page-titles">{item}</div>
            })}
        </div>

    </div>
  );
}

export default App;
